import React from 'react'
import '../Css/Project.css'
import Image from '../Images/img-1.png'
import ProjectList from './ProjectList'
const Project = () => {
    const projects = [
        {
            title : 'Project 1',
            sub_title : 'Coding is Love',
            desc : 'Lorem, ipsum dolor sit amet consectetur adipisicing elit. Ad, iusto cupiditate voluptatum impedit underem ipsa distinctio illum quae mollitia ut, accusantium eius odio ducimus illo neque atque libero non suntharum? Ipsum repellat animi, fugit architecto voluptatum odit et!'
        }
    ]
  return (
    <section id="projects">
        <div class="projects container">
            <div class="projects-header">
                <h1 class="section-title">Recent <span>Projects</span></h1>
            </div>
            <div class="all-projects">
                {projects.map( (oldval,index) => {
                    return <ProjectList key = {index} title = {oldval.title} sub_title = {oldval.sub_title} desc = {oldval.desc}></ProjectList>
                })}
            </div>
        </div>
  </section>
  )
}

export default Project
